import React from 'react';
//import imagelogo from '../../imagelogo.png';
import DialogsCss from './Dialogs.module.css';
import {NavLink} from 'react-router-dom';

const Dialog = (props) => {
    return (
        <article className={DialogsCss.dialog + ' ' + DialogsCss.active}>
            <NavLink to={"dialogs/" + props.id}>{props.name}</NavLink>
        </article>
    )
}

const Message = (props) => {
    return (
        <article className={DialogsCss.message}>
                    {props.message}
                </article>
    )
}


const Dialogs = (props) => {
    return (
        <section className={DialogsCss.section}>
            <div className={DialogsCss.dialogs}>
                <Dialog name='Dvytro' id='1'/>
                <Dialog name='Vasylyna' id='2'/>
                <Dialog name='Ivan' id='3'/>
                <Dialog name='Slavko' id='4'/>
                <Dialog name='Petro' id='5'/>
            </div>

            <div className={DialogsCss.messages}>
                <Message message='Div.mess'/>
                <Message message='Hi'/>
                <Message message='Vay'/>
            </div>
        </section>
    );
}

export default Dialogs;
